function Header() {
    return (
        <header>
            <h1>{content}</h1>
            <h4>Teacher:{`${firstName} ${lastName}`}  </h4>
            <p>year: {year}</p>
        </header>
    )
}


function Main() {
    return (<main>
        <h2>To get start React you should know : </h2>
        <ul>
            <li>HTML</li>
            <li>CSS</li>
            <li>JavaScript</li>
        </ul>
    </main>)
}


function Footer() {
    return (<footer>
        <p>Copyrigth  &copy; {year}</p>
    </footer>)
}


function App() {
    return (<div>
        <Header 
            const content="Let's start with React"
const firstName = "Asabeneh"
        const lastName = "Yatayeh"
        const year = {new Date().getFullYear()}

                />
        <Main />
        <Footer />
    </div>)
}

const rootElement = document.getElementById('root');
ReactDOM.render(<App />, rootElement);
